import React from "react";

import CreateButton from "./CreateButton";
import CreateModal from "./CreateModal";
import { examples } from "./examples";

export default class BlueprintOverview extends React.Component {
    constructor() {
        super();
        this.state = { blueprints: [] };
        this.showCreate = this.showCreate.bind(this);
    }

    componentDidMount() {
        //Here'd go a GET ajax call to server for all existing blueprints.
        this.setState({
            blueprints: examples
        });
    }

    showCreate() {
        this.setState({ showCreate: true });
        console.log("boom!");
    }

    render() {
        console.log("BlueprintOverview Component state -> ", this.state);
        //blueprint HTML template
        let blueprintsHtml = this.state.blueprints.map(i => {
            return (
                <div className="each-blueprint" key={i.blueprint_uuid}>
                    <div>{i.name}</div>
                </div>
            );
        });

        return (
            <div className="blueprint-overview-component">
                <CreateButton showCreate={this.showCreate} />
                {blueprintsHtml}
                <CreateModal />
            </div>
        );
    }
}
